import React from 'react';
import './Projetos.css';

const Projetos = () => {
    return (
        <section id="projetos" className="projetos">
            <h2 className="titulo-secao">Projetos Desenvolvidos</h2>
            <p className="descricao-secao">Confira alguns dos projetos que desenvolvi:</p>
            <div className="projetos-lista">
                <div className="projeto-card">
                    <h3 className="projeto-titulo">Gestão de Academias</h3>
                    <p className="projeto-descricao">
                        Sistema de gestão de academias desenvolvido com Node.js e React.
                    </p>
                    <button className="projeto-botao">Ver Mais</button>
                </div>
                <div className="projeto-card">
                    <h3 className="projeto-titulo">Portal Acadêmico</h3>
                    <p className="projeto-descricao">
                        Portal de notícias para estudos desenvolvido com Java e MySQL.
                    </p>
                    <button className="projeto-botao">Ver Mais</button>
                </div>
            </div>
        </section>
    );
};

export default Projetos;
